import { useState } from "react";

export default function Board() {
  function Square() {
    const [value, setValue] = useState(null);
    function handleClick() {
      setValue('X');
    }
    return <button 
      className="square"
      onClick={handleClick}  
    >
      {value}
    </button>;
  }
  return (
    <>
      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>
      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>
      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>
    </>
  );
}
